/**
 * Session token storage service.
 * @name authCookie
 * @param {$cookies} $cookies
 * @returns {*}
 */
export default function authCookie ($cookies) {
  'ngInject';

  const STORAGE_NAMESPACE = 'authenticated';

  return {
    /**
     * Save session token.
     * @name authCookie#set
     * @param {string} token
     * @return {authCookie}
     */
    set(token) {
      $cookies.put(STORAGE_NAMESPACE, token);
      return this;
    },
    /**
     * Get current session token.
     * @name authCookie#get
     * @return {*}
     */
    get() {
      return $cookies.get(STORAGE_NAMESPACE);
    },
    /**
     * Check if session token is set.
     * @name authCookie#has
     * @return {boolean}
     */
    has() {
      return !!$cookies.get(STORAGE_NAMESPACE);
    },
    /**
     * Destroy session token.
     * @name authCookie#destroy
     * @return {authCookie}
     */
    destroy() {
      $cookies.remove(STORAGE_NAMESPACE);
      return this;
    },
  };
}

import _ from 'lodash';
import assert from 'assert';

const LOGIN_EMPTY = 'Login is empty!';
const PASSWORD_EMPTY = 'Password is empty!';

/**
 * @name authentication
 * @param {$cookies} $cookies
 * @param {authCookie} authCookie
 * @param {loginStore} loginStore
 * @param {logoutStore} logoutStore
 * @returns {*}
 */
export default function authentication (
  $cookies,
  authCookie,
  loginStore,
  logoutStore
) {
  'ngInject';

  return {
    /**
     * Authenticate user and create user session
     * and emit state change event.
     * @name authentication#authenticate
     * @param {string} login
     * @param {string} password
     */
    async authenticate(login, password) {
      assert.ok(!_.isEmpty(login), LOGIN_EMPTY);
      assert.ok(!_.isEmpty(password), PASSWORD_EMPTY);
      // Make api request
      const response = await loginStore.push(login, password);
      if(response.authenticated) {
        authCookie.set(response.authenticated);
      }
    },
    /**
     * Destroy user session
     * and emit state change event.
     * @name authentication#destory
     */
    async destroy() {
      authCookie.destroy();
      await logoutStore.push();
    },
    /**
     * Returns if user is authorized.
     * @name authentication#isAuthenticated
     * @return {boolean}
     */
    isAuthenticated() {
      return authCookie.has();
    },
  };
}

/**
 * Password compliant validation.
 * @name password
 */
export default function password() {
  return {
    require: 'ngModel',
    link,
  };

  function link(scope, element, attributes, controller) {
    const PASSWORD_REGEXP = /(?=.*\d.*)(?=.*[A-Z].*)(?=.*[!#$%&*+,./:;<=>?@\^_~-].*)(?=.{10,})/;

    controller.$validators.password = (modelValue, viewValue) => {
      const isValid = controller.$isEmpty(modelValue) || PASSWORD_REGEXP.test(viewValue);
      return isValid;
    };
  }
}

