/**
 * Add to library directive.
 * @param {object} libraryModel
 * @param {object} loginModal
 * @param {object} Permission
 * @returns {restrict: string, scope: {type: string, id: string}, link: Function}
 */
export default function addToLibrary(libraryModel, loginModal, Permission) {
  'ngInject';

  return {
    restrict: 'CA',
    scope: {
      type: '@',
      id: '=',
    },

    link,
  };

  function link(scope, elem) {
    async function clickEvent() {
      try {
        await Permission.authorize({ only: [ROLE_USER] });
        addToLibrary(scope.type, scope.id);
      }
      catch(error) {
        loginModal.show();
      }
    }

    elem.bind('click', clickEvent);
  }

  async function addToLibrary(type, id) {
    switch(type) {
      case 'album':
        await libraryModel.addAlbumToLibrary(id);
        break;
      case 'artist':
        await libraryModel.addArtistToLibrary(id);
        break;
      case 'song':
        await libraryModel.addSongToLibrary(id);
        break;
    }
  }
}

/**
 * Remove from library directive.
 * @param {object} libraryModel
 */
export default function removeFromLibrary (libraryModel) {

  'ngInject';

  return {
    restrict: 'CA',
    scope: {
      type: '@',
      id: '=',
      timestamp: '=',
    },
    link: function(scope, elem) {
      elem.bind('click', () => {
        switch(scope.type) {
          case 'album':
            libraryModel.removeAlbumFromLibrary(scope.id, scope.timestamp);
            break;
          case 'artist':
            libraryModel.removeArtistFromLibrary(scope.id, scope.timestamp);
            break;
          case 'song':
            libraryModel.removeSongFromLibrary(scope.id, scope.timestamp);
            break;
        }
      });
    },
  };
}

/**
 * Repeat complete directive to be used with ng-repeat.
 * Fires off the evaluation of an expression once ng-repeat has completed.
 * @example <div ng-repeat="i in [0,1,2,3,4]" repeat-complete="vm.repeatComplete()">Item</div>
 */
export default function repeatComplete() {
  'ngInject';

  function link(scope, element, attributes) {
    let completeExpression = attributes.repeatComplete;
    if(scope.$last) {
      scope.$evalAsync(completeExpression);
    }
  }

  return {
    restrict: 'A',
    link: link,
  };
}

