export default function LibraryCarousel() {
  'ngInject';

  return {
    restrict: 'E',
    template: require('./library-carousel.html'),
    controller: libraryCarouselCtrl,
    controllerAs: 'vm',
    scope: {
      entity: '@',
      slides: '=',
    },
    link: link,
  };

  function link(scope, element, attrs, ctrl) {
    let slider;

    function slickIt() {
      // Slick requires jQuery objects
      slider = $(element).find('.carousel');
      $(slider).slick({
        slidesToShow: 2,
        slidesToScroll: 1,
        mobileFirst: true,
        responsive: [
          {
            breakpoint: 768,
            settings: {
              slidesToShow: 3,
            },
          },
          {
            breakpoint: 1024,
            settings: {
              slidesToShow: 4,
            },
          },
        ],
      });
    }

    function destroy() {
      // Slick requires jQuery objects
      if(slider) {
        $(slider).slick('unslick');
      }
    }

    scope.$watch('triggerSlick',
      (newValue, oldValue) => {
        if(newValue === true) {
          slickIt();
        }
      });

    scope.$on('$destroy', destroy);
  }
}

