   * Retrieves the library data (songs, artists, albums).
   */
  async getLibrary() {
    try {
      let response = await this.myLibraryStore.fetch();
      if(response) {
        return response;
      }
    } catch(err) {
      this.$log.error(err);
    }
    this.toastr.error('Unable to retrieve library, please try again later');
    return null;
