import {USER_REDIRECT_TO, ROLE_USER} from 'constants';

/**
 * Angular config for my page.
 * @param {ui.router.state.$stateProvider} $stateProvider
 */
export default function userRoute($stateProvider) {

  'ngInject';

  $stateProvider
    .state('msl.user', {
      template: require('./templates/user.html'),
      data: {
        permissions: {
          only: [ROLE_USER],
          redirectTo: USER_REDIRECT_TO,
        },
      },
    })
    .state('msl.user.history', {
      url: '/my/history',
      template: require('./templates/user-history.html'),
      controller: 'userHistoryCtrl',
      controllerAs: 'vm',
    })
    .state('msl.user.likes', {
      url: '/my/likes',
      template: require('./templates/user-likes.html'),
      controller: 'userLikesCtrl',
      controllerAs: 'vm',
    })
    .state('msl.user.library', {
      url: '/my/library',
      template: require('./templates/user-library.html'),
      controller: 'userLibraryCtrl',
      controllerAs: 'vm',
    });
}

export default function defaultRoute ($urlRouterProvider, $httpProvider) {
  'ngInject';

  // Makes possible to send httpOnly cookie on query requests and responses
  $httpProvider.defaults.withCredentials = true;
  // When user comes with empty url - this means first page open
  // then redirect it to root page.
  $urlRouterProvider.when('', '/');
  // When state is not found then redirect user to error state
  $urlRouterProvider.otherwise(($injector) => {
    const $state = $injector.get('$state');
    $state.go('error');
  });
}

import { ROLE_ANONYMOUS, ROLE_USER } from 'constants';

export default function defaultRun(Permission, authentication) {
  'ngInject';
  Permission
    .defineRole(ROLE_ANONYMOUS, () => !authentication.isAuthenticated())
    .defineRole(ROLE_USER, () => authentication.isAuthenticated());
}
